import React from 'react'
import { Col, Container, Row } from 'react-bootstrap';

function CardPage() {
  return (
    <div>
     <Container fluid>
       <Container>
        <Row>
            <Col cla>
            <h1>Our Courses</h1>
            </Col>
        </Row>
       </Container>
     </Container>
    </div>
  )
}

export default CardPage;
